import React, { useState } from "react";
import PropTypes, { array, object, string } from "prop-types";
import Post from "./postt/post";
import Carousel from "./Photo-carousel"
const Myposts = () => {
  return (
    <div className="center">
      <Post />
      <Carousel/>
    </div>
  );
};


export default Myposts;
